extern exit, memcpy

section .data
    text db ``

section .bss
    buf1 resb 1024

section .text
    global _start

_start:
    mov r15, 1_000_000_00
.loop:
    mov rdi, buf1
    mov rsi, text
    mov rdx, 1024
    call memcpy

    dec r15
    test r15, r15
    jnz .loop

    ; exit
    mov rdi, 0
    call exit
